아 저거.... 뭔가 아닌가...? 
뭐지;;? 나중에 저남자하고도 
헤어지고 또 다른 남자 나타나지않나? 
그남자랑 결혼하지않나? 아닌가;; 나 뭐래;; 
갑자기 왜 그런 생각이 들지;;

짜증나니까 욕할거면 방해되니 꺼지라구요?
너나 웹툰에 방해되니 꺼지세요ㅋ
누가 누구보고 방해된대;;

아오 진짜 나이처먹고 염치도 드럽게 없네;;;
매번 간식 얻어먹으면서 미안하지도 않나?
이건 뭐 대책도 없으면서 집에서 놀고먹는 백수에 알바이유도 연애질때문에 하는거고 돈도 없으면서 먹을건 다 처먹고 다니고;;;
바비도 만나는 이유가 그냥 취집이 목적 아니냐?
전에 구웅 만날때도 현상황 고려도 안하고 결혼얘기나 꺼내고;;;
보면 볼수록 애가 모지라;;;; 
부모님이 뒷바라지 해주신덕에 취직 했으면 퇴사도 부모님이랑 같이 의논이라도 하던가;;; 결국 퇴사하고 한다는게 연애질하려고 알바나 하고있냐? 개념없는 백수년

35살 처먹고 취직도 못하고 알바ㄴㅏ 처 하고 있으면서
남이 사온 빵에 저렇게 진지하냐.
이쉑 가면 갈수록 별로네;;;

바비가 아깝지
유미는 나이처먹고도 너무 생각없음;;
노답인생 백수년

엄... 그 처녀빗치인가 뭔가 하는건 ㅈ본쪽 작가가 지은거고... 제목으로 책보는 사람은 없자너? 내용으로 보지.
근데 로리타 라노벨 그런건 극혐이긴 하던데; 
음... 근데 그고 자료가 어디있죠? 출처좀 ㅎㅎ

사랑하는 만큼 잘 해주지 그랬어? 구웅 전남친의 정석이다 ㅋㅋ 뭣 같다 뭣같애. 자기 잘 못한 건 스킵하고 좋은 추억만 가지고 미련 그득해선... 제발 있을 때 잘해, 있을 때. 잘하라고 울고 불고 상처 받으면서도 옆에서 지켜준 당시 여친 밀어낸 건 언제고; 

구웅에피라서 유미 입장은 다들 생각 안 하지만... 유미 입장에선, 여친도 아닌 여자에게 사심 정리 못해서 내치지도 못하고 중간에서 유미만 이상한 여자로 만들어버린 장본인도 그 때 남친인 구웅 본인이었고, 구웅 힘들 때 여자친구인 유미가 위로 한마디라도 못 건내게 무력한 존재로 만들었으면서 이제 와 유미 새로운 사랑하니까 그리움 빙자해서 얼쩡거린다? 정말 경멸스러울 것 같음. 이번에도 지 생각만 하는구나. 이 새ㄲ1가 나 나쁜 년 만들려고 작정했구나. 

이번 편 댓글 반응만 봐도 희대의 쓰레기 됐을거라며... ㅋㅋㅋㅋ 구웅 지 구질구질한 미련 때문에 유미만 애먼 욕 먹음 유미가 주인공이 아니었어도 난 유미 욕 못했을 것임

